import React from "react";
import styles from "./banner.module.css";
import { Link } from "react-router-dom";

function Header() {
  return (
    <div className={styles.bannerImage}>
      <Link to="/">
        <img src={require("../images/main_banner.png")} alt="logo"/>
      </Link>
    </div>
  )
}
export default Header;
